import { Container, Row, Col, ListGroup, } from 'react-bootstrap';

const ResponsePagination = () => {

    return (
        <Container >
                    <ListGroup as="ul">
                        <ListGroup.Item as="li" action href="#link1" active>
                            Cras justo odio
                        </ListGroup.Item>
                        <ListGroup.Item as="li" action href="#link2" >Dapibus ac facilisis in</ListGroup.Item>
                        <ListGroup.Item as="li" action href="#link3">
                            Morbi leo risus
                        </ListGroup.Item>
                        <ListGroup.Item as="li" action href="#link4">Porta ac consectetur ac</ListGroup.Item>
                    </ListGroup>
        </Container>
    );
};

export default ResponsePagination;
